クリップ式でかんたん取付け！静音タイプのカーファンです。<br>軽自動車～トラックやオフィスが快適空間に！<br><br>お車のアクセサリーソケット（DC12V/DC24V対応）に付属のUSB変換アダプターを接続して車内で使用することも可能です。<br>クリップ式なので取付けもカンタン！<br><br>■風の角度も自由自在！360度の調節が可能。<br>■風量は2段階調節。<br>■静音タイプ。<br> ■パソコン等のUSBポートでも使用可能。<br>■脱着式の自立スタンド付き。<br><br><br>【仕様】<br>カラー：ブラック<br>電源：USB DC5V、MAX500mA<br>USBコード長：約3m <br>本体サイズ：約W215×H300×D205mm<br>重量：約490g<br>材質：本体 ABS/グリップ部 PP<br>付属品：専用USB変換アダプター、自立スタンド<br><br>メーカー品番：UPF-21<br>メーカー：大自工業/メルテック<style type="text/css">
