●日本初！ 大・中型トラック用一体式<br>
オールLEDリアコンビネーションランプ<br>
※2016年1月生産車（全長6m超車両）から義務付けとなるバックランプ2個付に対応<br>
●UN（ECE）部品認証取得品<br>
KOITO配光技術により斬新なデザインを実現、後続車からの視認性を大幅アップ！<br>
Wide&Smart<br>
洗練された新デザインで個性をアピール！<br>
 画期的なオールインワン！！<br>
【長寿命】 LED寿命40,000ｈ<br>
【作業性向上】 白熱タイプと取付互換<br>
●当該LEDリアコンビネーションランプ及びオプション品は、2010年以降に発売された車両を対象とします。<br>
●大型車・中型車の区分については、車両についている車検証をご確認下さい。<br>
●ふそう・UDトラックス車は、別途、コネクタ変換ハーネスが必要です。<br>
●日野車は、別途、ウォーニングキャンセラーが必要となります。<br>
●トレーラーは、別途、ウォーニングキャンセラーが必要となる場合があります。<br>
●ウォーニングキャンセラーをご使用の場合、省電力化が損なわれる場合があります。<br>
●バックランプは、別途、バックランプ用分岐ハーネスが必要となります。<br>
<br>
